window.bookSummaryJSON = "<p>Anthony is free!</p> <p>And he brought friends back to the Colony in the form of the monstrous bear Sarah, and the devious worm, Jim. But things aren't all going the way of our antrepid antventurer.</p> <p>Enemies abound, and the Colony has drawn to much attention.</p> <p>When the Legionem Abyssi, led by Commander Titus, come knocking on his door, will Anthony be able to repel the greatest army beneath the ground?</p> <p>Through all the struggle, strife, betrayal and sacrifice, our hero must persist, and defend the gate.</p> <p>Book 5 of the hit monster-evolution LitRPG series with nearly 30 Million views on Royal Road. Grab your copy today!</p>"; 
